	Camera:GetPropertyChangedSignal("FieldOfView"):Connect(LPH_NO_VIRTUALIZE(function()
		if flags.Zoom and flags["Zoom Activation"].Toggled then
			Camera.FieldOfView = flags.ZoomFOV
			return
